import time
import numpy as np

def jump(nums):
    
    jump_num_vec = np.zeros_like(nums)

    if len(nums)==1:
        return 0

    for ind,num in enumerate(nums):
        if jump_num_vec[ind] > 0 or ind==0:
            jump_num_vec[ind:ind+num+1][jump_num_vec[ind:ind+num+1] == 0] = jump_num_vec[ind] + 1
        if jump_num_vec[-1] > 0:
            return(jump_num_vec[-1])



def jump_0(nums):
    accessed_inds = [False]*len(nums)
    accessed_inds[0] = True
    last_ind = len(nums)-1
    accessible_inds = [0]
    if len(nums)==1:
        return 0
    
    for jump_num in range(1,len(nums)):
        accessible_inds_new = []
        # # bypass if can reach the end in this step
        # nums_subset = [nums[ind]+ind for ind in accessible_inds]
        # if max(nums_subset) >= last_ind:
        #     return jump_num
        for ind in accessible_inds:
            num = nums[ind]
            [accessible_inds_new.append(ind+i) for i in range(len(accessed_inds[ind:ind+num+1])) if accessed_inds[ind:ind+num+1][i] is False]
            accessed_inds[ind:ind+num+1] = [True]*(num+1)
            if accessed_inds[-1]:
                return jump_num
        accessible_inds = accessible_inds_new

def test_0():
    nums = [2,3,1,1,4]
    assert jump(nums) == 2

def test_1():
    nums = [2,3,0,1,4]
    assert jump(nums) == 2

def test_2():
    nums = [1,2,3]
    assert jump(nums) == 2

